insert  into `v2_bee_type`(`id`,`name`,`order_id`,`classify`,`is_manage`,`desc`,`component`,`deleted_at`,`created_at`,`updated_at`) values (1,'病假',4,1,0,'<div class=\"item\">糖糖，注意保重身体哦~ </div>\r\n<div class=\"item\">1、请病假须上传本人看病记录及凭证；病假3天以上（含3天），须上传区县级以上医院（含区县级医院）开具的休假证明。</div>\r\n<div class=\"item\">2、病假期间发放50%工资，无全勤奖。</div>',NULL,NULL,'2019-05-11 16:58:36','2019-05-11 16:58:36'),(2,'事假',3,1,0,'<div class=\"item\">1、糖糖请注意，如有调休请优先使用调休。</div>\r\n<div class=\"item\">2、事假期间无工资，无全勤奖。</div>',NULL,NULL,'2019-05-11 16:58:36','2019-05-11 16:58:36'),(3,'年休假',2,1,0,'<div class=\"item\">1、累计工作满1年，转正后享受带薪年休假。</div>\r\n<div class=\"item\">2、累计工作已满1年不满10年，年休假5天。</div>\r\n<div class=\"item\">3、累计工作已满10年不满20年的，年休假10天。</div>\r\n<div class=\"item\">4、累计工作已满20年的，年休假15天。</div>\r\n<div class=\"item\">5、累积工作满1年、10年、20年的，自满当日起可享受相应的年休假天数。</div>\r\n<div class=\"item\">6、当年度在公司工作不足12个月的：年休假计算方式＝（当年度在公司实际工作日历天数÷365）×本人当年度工作满12个月时可休的年休假天数；折算后不足半天的部分不计。</div>\r\n<div class=\"item\">7、年休假期间带薪，无全勤奖。</div>','Year',NULL,'2019-05-11 17:01:19','2019-05-11 17:01:19'),(4,'公出',4,2,0,'<div class=\"item\">因公在工作地所属城区内办事，不涉及食宿和城际交通。</div>',NULL,NULL,'2019-05-11 17:03:24','2019-05-11 17:03:24'),(5,'出差',5,2,0,'<div class=\"item\">因公去工作地以外的城市办事，涉及食宿和城际交通。</div>\r\n<div class=\"item\">糖糖出差前做好工作交接与安排，出门在外注意安全。</div>',NULL,NULL,'2019-05-11 17:04:12','2019-05-11 17:04:12'),(6,'调休',1,1,0,'<div class=\"item\">糖糖要劳逸结合，会休息的人才会工作,如有调休剩余，建议尽快调休哦。 </div>\r\n<div class=\"item\">1、调休期间带薪、有全勤奖。</div>\r\n<div class=\"item\">2、未调休的时长处理方式：</div>\r\n<div class=\"item\">\r\n  <div class=\"desc\">\r\n    1）累计调休天数超过10天的，按工作时间先后顺序，核算加班工资。\r\n  </div>\r\n  <div class=\"desc\">\r\n    2）每年1月，按工作日期核算，如有超出1年尚未调休的，核算加班工资。\r\n  </div>\r\n</div>','Rest',NULL,'2019-05-11 17:04:12','2019-05-11 17:04:12'),(7,'公假',11,1,1,NULL,NULL,NULL,'2019-05-11 17:06:53','2019-05-11 17:06:53'),(8,'婚假',5,1,0,'<div class=\"item\">恭喜糖糖！</div>\r\n<div class=\"item\">1、首次请婚假须上传本人结婚证。</div>\r\n<div class=\"item\">2、入职后依法登记结婚的员工，转正后，可休婚假(婚育变更请尽快至我的信息登记哦<a href=\"http://focushr.vemic.com/dew/userinfo\" target=\"_blank\">http://focushr.vemic.com/dew/userinfo</a>)。</div>\r\n<div class=\"item\">3、休婚假的有效期限为2年，自领证结婚之日起计算。</div>\r\n<div class=\"item\">4、婚假休假方式为2种：\r\n  <div class=\"desc\">\r\n    1）一次休完，休假天数含公休及节假日。\r\n  </div>\r\n  <div class=\"desc\">\r\n    2）分两次休，休假时间最短为半天，休假天数按照工作日累计计算（参考链接：<a href=\"http://oa.vemic.com/regulation/news/view/id/579\" target=\"_blank\">http://oa.vemic.com/regulation/news/view/id/579</a>）。\r\n  </div>\r\n</div>\r\n<div class=\"item\">5、婚假期间带薪，无全勤奖。</div>\r\n<div class=\"item\">6、员工向人力资源部报备领证结婚当月，公司给予结婚礼金庆贺。</div>',NULL,NULL,'2019-05-11 17:14:01','2019-05-11 17:14:01'),(9,'迟到',12,1,1,NULL,NULL,NULL,'2019-05-11 17:14:02','2019-05-11 17:14:02'),(10,'早退',13,1,1,NULL,NULL,NULL,'2019-05-11 17:09:47','2019-05-11 17:09:47'),(11,'旷工',7,1,1,NULL,NULL,NULL,'2019-05-11 17:09:47','2019-05-11 17:09:47'),(12,'产假',7,1,0,'<div class=\"item\">1、符合计划生育政策的女员工，生育或流产后，可按社保缴纳地政策一次性休产假。</div>\r\n<div class=\"item\">2、产假期间带薪，无全勤奖。</div>\r\n',NULL,NULL,'2019-05-11 17:10:14','2019-05-11 17:10:14'),(13,'护理假',8,1,0,'<div class=\"item\">恭喜糖糖！</div>\r\n<div class=\"item\">1、首次请护理假须上传出生证明。</div>\r\n<div class=\"item\">2、符合计划生育政策的男员工，可按其社保缴纳地规定休护理假。</div>\r\n<div class=\"item\">3、休护理假的有效期限为6个月，自孩子出生之日起计算。</div>\r\n<div class=\"item\">\r\n  4、护理假休假方式分2种：\r\n  <div class=\"desc\">\r\n    1）一次休完，休假天数含公休及节假日。\r\n  </div>\r\n  <div class=\"desc\">\r\n    2）分两次休，休假时间最短为半天，休假天数按照工作日累计计算。\r\n  </div>\r\n</div>\r\n<div class=\"item\">5、护理假期间带薪，无全勤奖。</div>',NULL,NULL,'2019-05-11 17:10:36','2019-05-11 17:10:36'),(14,'丧假',10,1,0,'<div class=\"item\">糖糖，请节哀顺变！</div>\r\n<div class=\"item\">1、员工父母、配偶、子女、兄弟姐妹、岳父母、公婆、祖父母、外祖父母去世，可一次休1~3天丧假，请填写亲属关系。</div>\r\n<div class=\"item\">2、丧假期间带薪，无全勤奖。</div>\r\n<div class=\"item\">3、员工的父母、配偶、子女去世，公司给予丧抚慰问金。</div>',NULL,NULL,'2019-05-11 17:11:44','2019-05-11 17:11:44'),(15,'加班',15,3,0,'<div class=\"item\">因工作量增加、突增工作任务等工作原因，无法在日常工作时间及弹性工作时间内完成工作任务时，部门或项目负责人可安排相关岗位员工加班，加班时间按工作量核定。加班的糖糖要劳逸结合哦。</div>',NULL,NULL,'2019-05-12 10:56:29','2019-05-12 10:56:29'),(16,'产检假',6,1,0,'<div class=\"item\">1、符合计划生育政策的女员工，根据产检需要，在相应时段内给予每次半天或一天的产检假。</div>\r\n<div class=\"item\">2、产检假期间带薪，无全勤奖。</div>',NULL,NULL,'2019-05-12 10:56:29','2019-05-12 10:56:29'),(17,'哺乳假',9,1,0,'<div class=\"item\">1、符合计划生育政策的女员工，生育后1年工作时间内，每个工作日内给予2次哺乳时间，每次哺乳时间30分钟；多胞胎生育的，每多哺乳一个婴儿，每次哺乳时间增加30分钟；2次哺乳时间，可以合并使用。</div>\r\n<div class=\"item\">2、如因客观情况有需求，可按月休哺乳假，每月2天。如当月工作天数不足16天，哺乳假时间折算=工作天数/8。不足半天不算，哺乳假半天起休。</div>\r\n<div class=\"item\">3、哺乳假期间带薪，无全勤奖。</div>',NULL,NULL,'2019-05-12 10:56:29','2019-05-12 10:56:29'),(18,'在家办公',18,2,1,NULL,NULL,NULL,'2019-05-12 10:56:29','2019-05-12 10:56:29');

